function Vibor({ isVisible, onClose }) {
    const [activeModal, setActiveModal] = useState('main');
    
  const openTrainerSelection = () => setActiveModal('trainer');
  const openProgramSelection = () => setActiveModal('program');
  const openDateSelection = () => setActiveModal('data');
  const backToMain = () => setActiveModal('main');
  const openEndSelection = () => setActiveModal('end');
  useEffect(() => {
    const handleKeyDown = (event) => {
      if (event.keyCode === 27) {
        onClose();
      }
    };
    if (isVisible) {
      document.addEventListener('keydown', handleKeyDown);
    }
    return () => {
      document.removeEventListener('keydown', handleKeyDown);
    };
  }, [isVisible, onClose]); 

  if (!isVisible) return null;
  if (!isVisible) return null;
  return (
    <div>
      {activeModal === 'main' && (
        <MainModal 
          onChooseTrainer={openTrainerSelection}
          onChooseProgram={openProgramSelection}
          onChooseDate={openDateSelection} 
          OnChoseEnd={openEndSelection}
          setActiveModal={setActiveModal}
        />
      )}
      {activeModal === 'trainer' && (
        <TrainerSelectionModal onBack={backToMain} />
      )}
      {activeModal === 'program' && (
        <ProgramSelectionModal onBack={backToMain} />
      )}
        {activeModal === 'data' && (
        <DateSelectionModal onBack={backToMain} />
      )}
       {activeModal === 'end' && (
        <EndSelection onBack={backToMain} />
      )}
    </div>
  );
}
